import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav class="navbar navbar-expand-sm bg-dark navbar-dark">
          <a class="navbar-brand" href="IOHome.html"><img src="" alt="Logo" style="widows: 80px;px;" href="IOHome.html"></img></a>

            <ul class="navbar-nav">
              <li class="nav-item">
                <a class="nav-link" href=""></a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href=""></a>
              </li>
              </ul>
          </nav> 
      </header>
    </div>
  );
}

export default App;
